webpackJsonp([1476],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-javascript-for-of-loop.json":function(e,n){e.exports={data:{markdownRemark:{html:'<p>The <code>for..of</code> statement creates a loop iterating over iterable objects (including Array, Map, Set, Arguments object and so on), invoking a custom iteration hook with statements to be executed for the value of each distinct property.</p>\n<pre><code>for (variable of object) {\n  statement\n}\n</code></pre>\n<table>\n<thead>\n<tr>\n<th></th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>variable</td>\n<td>On each iteration a value of a different property is assigned to variable.</td>\n</tr>\n<tr>\n<td>object</td>\n<td>Object whose enumerable properties are iterated.</td>\n</tr>\n</tbody>\n</table>\n<p><a href="https://developer.mozilla.org/en/docs/Web/JavaScript/Reference/Statements/for...of">MDN link</a> | <a href="https://msdn.microsoft.com/library/dn858238(v=vs.94).aspx?f=255&#x26;MSPPError=-2147217396">MSDN link</a> | <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Functions/arguments/@@iterator">arguments @@iterator</a></p>\n<h2>Examples</h2>\n<h3>Array</h3>\n<pre><code>let arr = [ "fred", "tom", "bob" ];\n\nfor (let i of arr) {\n    console.log(i);\n}\n\n// Output:\n// fred\n// tom\n// bob\n</code></pre>\n<h3>Map</h3>\n<pre><code>var m = new Map();\nm.set(1, "black");\nm.set(2, "red");\n\nfor (var n of m) {\nconsole.log(n);\n}\n\n// Output:\n// 1,black\n// 2,red\n</code></pre>\n<h3>Set</h3>\n<pre><code>var s = new Set();\ns.add(1);\ns.add("red");\n\nfor (var n of s) {\nconsole.log(n);\n}\n\n// Output:\n// 1\n// red\n</code></pre>\n<h3>Arguments object</h3>\n<pre><code>// your browser must support for..of loop\n// and let-scoped variables in for loops\n\nfunction DisplayArgumentsObject()\n{\n    for (let n of arguments) {\n    console.log(n);\n    }\n}\n\nDisplayArgumentsObject(1,"red");\n\n// Output:\n// 1\n// red\n</code></pre>',frontmatter:{title:"JavaScript for of Loop",parent:"/home/stuart/guides/src/pages/articles/javascript/javascript-for-of-loop/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/javascript-for-of-loop/"}}}});
